// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;

import "./openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "./openzeppelin/contracts/utils/EnumerableSet.sol";
import "./openzeppelin/contracts/math/SafeMath.sol";
import "./openzeppelin/contracts/access/Ownable.sol";
import "./uniswapv2/IUniswapV2Pair.sol";
import "./uniswapv2/IUniswapV2Factory.sol";
import "./TenetMine.sol";
import "./Tenet.sol";

contract TenetProxy is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    uint256 public constant MINLPTOKEN_AMOUNT = 10000000000;
    uint256 public constant MINWEALTH_AMOUNT = 100000000000000000;
    Tenet public tenet;
    TenetMine public tenetmine;
    address public weth;
    address public wusdt;

    constructor(Tenet _tenet,TenetMine _tenetmine,address _weth,address _wusdt) public {
        tenet = _tenet;
        tenetmine = _tenetmine;
        weth = _weth;
        wusdt = _wusdt;
    }
    // 查询tenpool的信息
    function getTenUserPool() external view returns (uint256,uint256,uint256,uint256,uint256) {
        (uint256 lastRewardBlock,uint256 accTenPerShare,uint256 allocPoint,uint256 lpTokenTotalAmount) = tenet.tenUserPool();
        uint256 totalAllocPoint = tenet.totalAllocPoint();
        return (lastRewardBlock,accTenPerShare,allocPoint,lpTokenTotalAmount,totalAllocPoint);
    }
    function getTenProjectPool() external view returns (uint256,uint256,uint256,uint256,uint256) {
        (uint256 lastRewardBlock,uint256 accTenPerShare,uint256 allocPoint,uint256 lpTokenTotalAmount) = tenet.tenProjectPool();
        uint256 totalAllocPoint = tenet.totalAllocPoint();
        return (lastRewardBlock,accTenPerShare,allocPoint,lpTokenTotalAmount,totalAllocPoint);
    }
    function getBonusPool(uint256 _pid) external view returns (uint256,uint256,uint256,uint256,uint256,uint256) {
        (, ,uint256 lastRewardBlock,uint256 lpTokenTotalAmount,uint256 accTokenPerShare,uint256 accTenPerShare, , , , , , , ,uint256 userCount) = tenet.poolInfo(_pid);
        uint256 newBlockTen = getTenPerBlockByProject(_pid);
        return (lastRewardBlock,lpTokenTotalAmount,accTokenPerShare,accTenPerShare,newBlockTen,userCount);
    }
    function getTenPoolBasicInfo() external view returns (address,address,address,address,address,uint256,uint256,uint256,string memory,string memory,string memory) {
        IUniswapV2Pair pairAddr = IUniswapV2Pair(address(tenet.lpTokenTen()));
        ERC20 tokenAddr = ERC20(address(tenet.ten()));
        ERC20 token0Addr = ERC20(IUniswapV2Pair(address(pairAddr)).token0());
        ERC20 token1Addr = ERC20(IUniswapV2Pair(address(pairAddr)).token1());
        return (IUniswapV2Pair(address(pairAddr)).factory(),address(pairAddr),address(tokenAddr),address(token0Addr),address(token1Addr),tokenAddr.decimals(),token0Addr.decimals(),token1Addr.decimals(),tokenAddr.symbol(),token0Addr.symbol(),token1Addr.symbol());
    }
    // 查询pool的基本信息
    function getPoolBasicInfo(uint256 _pid) external view returns (address,address,address,address,address,uint256,uint256,uint256,string memory,string memory,string memory) {
        (IERC20 pairAddr,IERC20 tokenAddr, , , , , , , , , , , ,) = tenet.poolInfo(_pid);
        ERC20 token0Addr = ERC20(IUniswapV2Pair(address(pairAddr)).token0());
        ERC20 token1Addr = ERC20(IUniswapV2Pair(address(pairAddr)).token1());
        return (IUniswapV2Pair(address(pairAddr)).factory(),address(pairAddr),address(tokenAddr),address(token0Addr),address(token1Addr),ERC20(address(tokenAddr)).decimals(),ERC20(address(token0Addr)).decimals(),ERC20(address(token1Addr)).decimals(),ERC20(address(tokenAddr)).symbol(),token0Addr.symbol(),token1Addr.symbol());
    }
    // 查询pool里面各个token价值信息
    function getPoolPriceInfo(IUniswapV2Pair pairAddr,IUniswapV2Factory factory,address token0Addr,address token1Addr) external view returns (uint256,uint256,uint256,uint256,uint256,uint256) {
        uint256 lpSupply = pairAddr.totalSupply();
        (uint reserve0, uint reserve1,) = pairAddr.getReserves();
        //IUniswapV2Factory factory = IUniswapV2Factory(pairAddr.factory());
        (uint256 pricetype,uint256 price0,uint256 price1) = calcTokenPrice(factory,token0Addr,token1Addr);     
        return (lpSupply,reserve0,reserve1,pricetype,price0,price1);
    }
    // 计算每个token价值多少wealth
    function calcTokenPrice(IUniswapV2Factory factory,address token0Addr,address token1Addr) public view returns (uint256,uint256,uint256) {
        uint256 pricetype = 0;
        uint256 price0 = 0;
        uint256 price1 = 0;     
        price0 = calcTokenWealth(factory,token0Addr,weth);
        if(price0 == 0){
            price1 = calcTokenWealth(factory,token1Addr,weth);
            if(price1 == 0){
                pricetype = 1;//表示目前的价格标的为usd
                price0 = calcTokenWealth(factory,token0Addr,wusdt);
                if(price0 == 0){
                    price1 = calcTokenWealth(factory,token1Addr,wusdt);
                }
            }
        }
        return (pricetype,price0,price1);    
    }
    // 计算每个token价值多少wealth
    function calcTokenWealth(IUniswapV2Factory factory,address token,address wealth) public view returns (uint256) {
        if (token == wealth) {
           return MINWEALTH_AMOUNT;
        }
        IUniswapV2Pair pair = IUniswapV2Pair(factory.getPair(token, wealth));
        if (address(pair) == address(0)) {
            return 0;
        }
        (uint reserve0, uint reserve1,) = pair.getReserves();
        if(token == pair.token0()){
            return reserve1.mul(MINWEALTH_AMOUNT).div(reserve0);
        }
        return reserve0.mul(MINWEALTH_AMOUNT).div(reserve1);
    }
    // 查询提供tenlptonken的用户每个区块每个tenlptonken能分多少TEN
    function getTenPerBlockByUser() external view returns (uint256) {
        (,,uint256 allocPoint,uint256 lpSupply) = tenet.tenUserPool();
        if (lpSupply == 0) {//机构没有tenlptoken了
            return 0;
        }        
        uint256 tenReward = tenetmine.calcMineTenReward(block.number-1, block.number);
        tenReward = tenReward.mul(allocPoint).div(tenet.totalAllocPoint());
        return tenReward.div(lpSupply);
    }
    // 查询提供tenlptonken的机构的这个项目,每个区块每个tenlptoken能分给每个用户的每个lptoken多少TEN币
    function getTenPerBlockByProject(uint _pid) public view returns (uint256) {
        //(IERC20 lpToken,IERC20 tokenAddr,uint256 lastRewardBlock,uint256 lpTokenAmount,uint256 e,uint256 f,address g,uint256 h,uint256 i,uint256 j,uint256 k,uint256 l,uint256 m,uint256 n) = tenet.poolInfo(_pid);
        ( , , ,uint256 lpTokenAmount, , , , , , , , , ,) = tenet.poolInfo(_pid);
        if(lpTokenAmount < MINLPTOKEN_AMOUNT){//项目没有用户了
            return 0;
        }
        (uint256 lpSupply,) = tenet.userInfoProjectPool(_pid);
        if (lpSupply == 0) {//机构没有tenlptoken了
            return 0;
        }
        ( , ,uint256 allocPoint,uint256 tenLPTokenAmount) = tenet.tenProjectPool();
        uint256 tenReward = tenetmine.calcMineTenReward(block.number-1, block.number);
        tenReward = tenReward.mul(allocPoint).div(tenet.totalAllocPoint());
        return tenReward.div(tenLPTokenAmount).div(lpTokenAmount);
    }
    // 查询提供lpten的机构还有多少TEN币可以领取
    function getPendingTenByProject(uint _pid) public view returns (uint256) {
        ( , , ,uint256 lpTokenTotalAmount, , , , , , , , , ,) = tenet.poolInfo(_pid);        
        if(lpTokenTotalAmount < MINLPTOKEN_AMOUNT){
            return 0;
        }
        (uint256 lpSupply,uint256 rewardTenDebt) = tenet.userInfoProjectPool(_pid);
        (uint256 lastRewardBlock,uint256 accTenPerShare ,uint256 allocPoint,uint256 tenlpTokenTotalAmount) = tenet.tenProjectPool();
        if (block.number > lastRewardBlock && lpSupply != 0) {
            uint256 tenReward = tenetmine.calcMineTenReward(lastRewardBlock, block.number);
            tenReward = tenReward.mul(allocPoint).div(tenet.totalAllocPoint());
            accTenPerShare = accTenPerShare.add(tenReward.mul(1e12).div(tenlpTokenTotalAmount));
        }
        return lpSupply.mul(accTenPerShare).div(1e12).sub(rewardTenDebt);
    }
    // 查询提供lpten的用户还有多少TEN币可以领取
    function getPendingTenByUser(address _user) external view returns (uint256) {
        (uint256 lpSupply, ,uint256 rewardTenDebt) = tenet.userInfoUserPool(_user);
        (uint256 lastRewardBlock,uint256 accTenPerShare ,uint256 allocPoint,uint256 tenlpTokenTotalAmount) = tenet.tenUserPool();
        if (block.number > lastRewardBlock && lpSupply != 0) {
             uint256 tenReward = tenetmine.calcMineTenReward(lastRewardBlock, block.number);
            tenReward = tenReward.mul(allocPoint).div(tenet.totalAllocPoint());
            accTenPerShare = accTenPerShare.add(tenReward.mul(1e12).div(tenlpTokenTotalAmount));
        }
        return lpSupply.mul(accTenPerShare).div(1e12).sub(rewardTenDebt);
    }

    // 查询用户还有多少TEN币可以领取
    function getPendingTen(uint256 _pid, address _user) external view returns (uint256) {
        uint256 pending = getPendingTenByProject(_pid);        
        ( , , ,uint256 lpTokenTotalAmount, ,uint256 accTenPerShare, , , , , , , ,) = tenet.poolInfo(_pid);
        accTenPerShare = accTenPerShare.add(pending.mul(1e12).div(lpTokenTotalAmount));
        (uint256 amount, ,uint256 rewardTenDebt) = tenet.getPoolUser(_pid,_user);
        return amount.mul(accTenPerShare).div(1e12).sub(rewardTenDebt);
    }

    // 查询用户还有多少机构空投的代币可以领取
    function getPendingToken(uint256 _pid, address _user) external view returns (uint256) {
        ( , ,uint256 lastRewardBlock,uint256 lpTokenTotalAmount,uint256 accTokenPerShare, , , , ,uint256 endBlock,uint256 tokenPerBlock,uint256 tokenBonusEndBlock,uint256 tokenBonusMultipler,) = tenet.poolInfo(_pid);
        (uint256 amount,uint256 rewardTokenDebt,) = tenet.getPoolUser(_pid,_user);
        if (block.number > lastRewardBlock && lpTokenTotalAmount != 0) {
            uint256 tokenReward = tokenPerBlock.mul(tenetmine.getMultiplier(lastRewardBlock, block.number,endBlock,tokenBonusEndBlock,tokenBonusMultipler));
            accTokenPerShare = accTokenPerShare.add(tokenReward.mul(1e12).div(lpTokenTotalAmount));
        }
        return amount.mul(accTokenPerShare).div(1e12).sub(rewardTokenDebt);
    }                
}
